  "fractals": "const styles = StyleSheet.create({\n  row: {\n    flexGrow: 1,\n    flexDirection: 'row',\n  },\n  column: {\n    flexGrow: 1,\n  },\n  text: {\n    margin: 10,\n    fontSize: 10,\n    color: 'white',\n  },\n});\n\nconst palette = [\n  '#781c81',\n  '#521b80',\n  '#442f8b',\n  '#3f4c9f',\n  '#4069b4',\n  '#4582c1',\n  '#4e96bd',\n  '#5aa6a9',\n  '#68b090',\n  '#7ab878',\n  '#8dbc64',\n  '#a2be56',\n  '#b7bd4b',\n  '#c9b843',\n  '#d8ae3d',\n  '#e29e37',\n  '#e78632',\n  '#e6672d',\n  '#e14427',\n  '#d92120',\n];\n\nconst toggle = direction => (direction === 'column' ? 'row' : 'column');\n\n// Creates Fractal Component that renders it's step with a background color\nconst Fractal = ({ steps, direction = 'column' }) => {\n  if (steps === 0) {\n    return null;\n  }\n\n  const fractalStyle = {\n    flexGrow: 1,\n    alignItems: 'center',\n    justifyContent: 'center',\n    backgroundColor: palette[steps],\n  };\n\n  return (\n    <View style={styles[direction]}>\n      <Fractal direction={toggle(direction)} steps={steps - 1} />\n      <View style={fractalStyle}>\n        <Text style={styles.text}>{steps}</Text>\n      </View>\n    </View>\n  );\n};\n\nconst doc = (\n  <Document\n    title=\"Fractals\"\n    author=\"John Doe\"\n    subject=\"Rendering fractals with react-pdf\"\n    keywords={['react', 'pdf', 'fractals']}\n  >\n    <Page size=\"A4\">\n      <Fractal steps={18} />\n    </Page>\n\n    <Page orientation=\"landscape\" size=\"A4\">\n      <Fractal steps={14} />\n    </Page>\n\n    <Page size=\"B4\">\n      <Fractal steps={10} />\n    </Page>\n  </Document>\n);\n\nReactPDF.render(doc);\n",
